import React, { useState } from "react";
import classes from './Profile.module.css';
import { Link} from "react-router-dom";

function Profile() {
  const [ProfileDetails, setProfileDetails] = useState({
    name: "",
    email: "",
    password: "",
    empcode: "",
    address: "",
    joiningdate: "",

  });
  const onChangeHandler = (e) => {
    let user = ProfileDetails;
    user[e.target.name] = e.target.value;
    setsignupDetails(user);
  };

  const onSubmitHandler = async (e) => {
    e.preventDefault();
    return;        
  }
    return (
      <div className={classes.SignUp}>
      <div className={classes.SignUp_Image}>
          <img src={SignUp_Img} alt="SignUp" />
      </div>
      <div className={classes.SignUp_Box}>
            <form onSubmit={onSubmitHandler}>
              <h1 className={classes.title_SU}>SIGN UP</h1>
              <br></br>
              <input
                type="text"
                placeholder="Name"
                name="name"
                value={signupDetails.name}
                onChange={onChangeHandler}
              /><br></br>

              <input
                type="email"
                placeholder="Email"
                name="email"
                value={signupDetails.email}
                onChange={onChangeHandler}
              /><br></br>

              <input
                type="password"
                placeholder="Password"
                name="password"
                value={signupDetails.password}
                onChange={onChangeHandler}
              /><br></br>

              <input
                type="text"
                placeholder="Emp-Code"
                name="empcode"
                value={signupDetails.empcode}
                onChange={onChangeHandler}
              /><br></br>

              <input
                type="text"
                placeholder="Address"
                name="address"
                value={signupDetails.address}
                onChange={onChangeHandler}
              /><br></br>

              <input
                type="date"
                placeholder="Joining date"
                name="joiningdate"
                value={signupDetails.joiningdate}
                onChange={onChangeHandler}
              /><br></br>

              <input type="submit" value="SUBMIT" />
              <br></br><br></br>
              <div className={classes.bottomLinkWrapper}>
              <Link to="/SignIn" className={classes.BottomLinks}>
                Have an account ?
              </Link>
            </div>
            </form>
        </div>
    </div>
    );
  }
  
  export default SignUp;
